import React from 'react'
import {Link} from 'react-router-dom'

const DogList = ({dogs}) => {
    return(
    <>
        <h1>Dog List</h1>
        {dogs.map(d => 
        <img src={`public/${d.name}.jpg`} alt='image of dog'></img>
        )}
    </>
    )
}

export default DogList;
